import React from 'react';
import styled from 'styled-components';
import './WhoComponent.css';
import image1 from '../../../Assets/image1.jpg';
import image2 from '../../../Assets/image2.jpg';
import image3 from '../../../Assets/image3.jpg';
import image4 from '../../../Assets/image4.jpg';

const Section = styled.div`
  height: 100vh;
 
  scroll-snap-align: center;
  overflow: hidden;
`;

const ParallaxContainer = styled.div`
  display: flex;
  flex-direction: column;
  height: 100vh;
  overflow-y: auto;
`;

const ParallaxImage = styled.div`
  height: 100vh;
  background-size: cover;
  background-repeat: no-repeat;
  background-position: center;
  transition: transform 0.3s ease-out;
  background-color: pink;

`;

const WhoComponent = () => {
  const parallaxData = [
    {
      imageUrl: image1,
      parallaxSpeed: 1,
    },
    {
      imageUrl: image2,
      parallaxSpeed: 2,
    },
    {
      imageUrl: image3,
      parallaxSpeed: 3,
    },
    {
      imageUrl: image4,
      parallaxSpeed: 4,
    },
  ];

  return (
    <Section>
      <ParallaxContainer>
        
          <ParallaxImage
            style={{ backgroundImage: `url(image1)`, transform: `translateY(5)` }}
          />
                    <ParallaxImage
            style={{ backgroundImage: `url(image2)`, transform: `translateY(5)` }}
          />
                    <ParallaxImage
            style={{ backgroundImage: `url(image2)`, transform: `translateY(5)` }}
          />
                    <ParallaxImage
            style={{ backgroundImage: `url(image4)`, transform: `translateY(5)` }}
          />
  
      </ParallaxContainer>
    </Section>
  );
};

export default WhoComponent;
